import Text from "../Text/Text"

const Page = () => {

    return (
        <>
            <Text type="h1" />
            <Text type="h2" />
            <Text type="h3" />
            <Text type="h4" />
            <Text type="paragraph" />
            <Text type="span" />
        </>
    )
}

export default Page
